<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>The Great Escape Calendar üéâ</title>
  <style>
    * { box-sizing: border-box; margin: 0; padding: 0; }
    body {
      min-height: 100vh;
      background: linear-gradient(135deg, #1a1a2e 0%, #16213e 50%, #0f3460 100%);
      padding: 20px;
      font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif;
    }
    .snowflake {
      position: fixed;
      color: white;
      pointer-events: none;
      opacity: 0.6;
      animation: fall linear infinite;
    }
    @keyframes fall {
      0% { transform: translateY(-10px) rotate(0deg); opacity: 0; }
      10% { opacity: 0.6; }
      90% { opacity: 0.6; }
      100% { transform: translateY(100vh) rotate(360deg); opacity: 0; }
    }
    .header { text-align: center; margin-bottom: 30px; position: relative; z-index: 1; }
    .header h1 { color: #ffd700; font-size: 2.5rem; text-shadow: 2px 2px 4px rgba(0,0,0,0.5); margin-bottom: 10px; }
    .header .subtitle { color: #e0e0e0; font-size: 1.2rem; font-style: italic; }
    .header .instruction { color: #ff6b6b; font-size: 1rem; margin-top: 5px; }
    .calendar-grid {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(90px, 1fr));
      gap: 12px;
      max-width: 800px;
      margin: 0 auto;
      padding: 20px;
      background: linear-gradient(145deg, #2d4a3e 0%, #1a332a 100%);
      border-radius: 20px;
      border: 4px solid #ffd700;
      box-shadow: 0 10px 40px rgba(0,0,0,0.5);
      position: relative;
      z-index: 1;
    }
    .door {
      aspect-ratio: 1;
      border-radius: 10px;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      cursor: pointer;
      transition: all 0.3s ease;
      position: relative;
      overflow: hidden;
    }
    .door.closed {
      background: linear-gradient(145deg, #8b0000 0%, #5c0000 100%);
      border: 3px solid #ffd700;
      box-shadow: 0 4px 15px rgba(0,0,0,0.3);
    }
    .door.closed:hover {
      transform: scale(1.05);
      box-shadow: 0 6px 20px rgba(255,215,0,0.4);
    }
    .door.opened {
      background: linear-gradient(145deg, #4a7c59 0%, #2d5a3d 100%);
      border: 3px solid #90EE90;
      box-shadow: inset 0 2px 10px rgba(0,0,0,0.3);
      transform: scale(0.95);
    }
    .door .day-number { font-size: 1.5rem; font-weight: bold; color: #ffd700; text-shadow: 1px 1px 2px rgba(0,0,0,0.5); }
    .door .day-date { font-size: 0.6rem; color: #ffecb3; margin-top: 2px; }
    .door .avatar { width: 90%; height: 90%; object-fit: contain; border-radius: 50%; }
    .progress-container {
      max-width: 800px;
      margin: 30px auto;
      padding: 20px;
      background: rgba(255,255,255,0.1);
      border-radius: 15px;
      position: relative;
      z-index: 1;
    }
    .progress-text { color: #ffd700; margin-bottom: 10px; text-align: center; }
    .progress-bar { height: 20px; background: #333; border-radius: 10px; overflow: hidden; }
    .progress-fill { height: 100%; background: linear-gradient(90deg, #ff6b6b, #ffd700, #90EE90); border-radius: 10px; transition: width 0.5s ease; }
    .modal-overlay {
      position: fixed;
      top: 0; left: 0; right: 0; bottom: 0;
      background: rgba(0,0,0,0.85);
      display: none;
      align-items: center;
      justify-content: center;
      z-index: 1000;
      padding: 20px;
    }
    .modal-overlay.active { display: flex; }
    .modal-content {
      background: linear-gradient(145deg, #2a2a4a 0%, #1a1a2e 100%);
      border-radius: 20px;
      padding: 30px;
      max-width: 450px;
      width: 100%;
      border: 3px solid #ffd700;
      box-shadow: 0 20px 60px rgba(0,0,0,0.5);
      text-align: center;
    }
    .modal-content h2 { color: #ffd700; font-size: 1.5rem; margin-bottom: 5px; }
    .modal-content .theme { color: #ff6b6b; font-size: 0.9rem; font-weight: bold; margin-bottom: 20px; }
    .modal-content .modal-avatar {
      width: 180px; height: 180px;
      object-fit: contain;
      margin: 0 auto 20px;
      border-radius: 50%;
      border: 3px solid #ffd700;
      box-shadow: 0 4px 20px rgba(255,215,0,0.3);
    }
    .modal-content .quip {
      color: #e0e0e0;
      font-size: 1.1rem;
      line-height: 1.6;
      font-style: italic;
      padding: 15px;
      background: rgba(255,215,0,0.1);
      border-radius: 10px;
      border: 1px solid rgba(255,215,0,0.3);
    }
    .modal-content button {
      margin-top: 20px;
      padding: 12px 30px;
      font-size: 1rem;
      background: linear-gradient(145deg, #ff6b6b, #cc5555);
      color: white;
      border: none;
      border-radius: 25px;
      cursor: pointer;
      font-weight: bold;
      box-shadow: 0 4px 15px rgba(255,107,107,0.3);
    }
    .modal-content button:hover { transform: scale(1.05); }
    .footer { text-align: center; color: #666; margin-top: 30px; font-size: 0.9rem; position: relative; z-index: 1; }
  </style>
</head>
<body>
  <!-- Snowflakes -->
  <div id="snowflakes"></div>
  
  <div class="header">
    <h1>üö™ The Great Escape Calendar üéâ</h1>
    <p class="subtitle">Countdown to Freedom: January 1st, 2025</p>
    <p class="instruction">Click a door each day to reveal the wisdom within!</p>
  </div>

  <div class="calendar-grid" id="calendar"></div>

  <div class="progress-container">
    <p class="progress-text" id="progress-text">Doors Opened: 0 / 31</p>
    <div class="progress-bar">
      <div class="progress-fill" id="progress-fill" style="width: 0%"></div>
    </div>
  </div>

  <div class="modal-overlay" id="modal">
    <div class="modal-content">
      <h2 id="modal-title">Day 1 - Dec 1</h2>
      <p class="theme" id="modal-theme">üìß Email Ninja</p>
      <img class="modal-avatar" id="modal-avatar" src="" alt="Avatar">
      <p class="quip" id="modal-quip">"Quote here"</p>
      <button onclick="closeModal()">Close Door üö™</button>
    </div>
  </div>

      { day: 30, date: "Dec 30", quip: "LAST DAY! It's not goodbye, it's 'see you on LinkedIn where I'll ignore your messages equally'!", theme: "üéâ Liberation Day" },
      { day: 31, date: "Dec 31", quip: "NEW YEAR'S EVE! Out with the old job, in with the... sleeping in!", theme: "ü•≥ Freedom Eve" },
    ];

    let openedDoors = JSON.parse(localStorage.getItem('escapeCalendarOpened') || '{}');

    function createSnowflakes() {
      const container = document.getElementById('snowflakes');
      for (let i = 0; i < 20; i++) {
        const flake = document.createElement('div');
        flake.className = 'snowflake';
        flake.textContent = '‚ùÑ';
        flake.style.left = Math.random() * 100 + '%';
        flake.style.fontSize = (Math.random() * 10 + 10) + 'px';
        flake.style.animationDuration = (Math.random() * 3 + 2) + 's';
        flake.style.animationDelay = Math.random() * 2 + 's';
        container.appendChild(flake);
      }
    }

    function renderCalendar() {
      const grid = document.getElementById('calendar');
      grid.innerHTML = '';
      calendarData.forEach(item => {
        const isOpened = openedDoors[item.day];
        const door = document.createElement('div');
        door.className = 'door ' + (isOpened ? 'opened' : 'closed');
        door.onclick = () => openDoor(item.day);
        
        if (isOpened) {
          door.innerHTML = '<img class="avatar" src="' + avatarImages[item.day] + '" alt="Day ' + item.day + '">';
        } else {
          door.innerHTML = '<span class="day-number">' + item.day + '</span><span class="day-date">' + item.date + '</span>';
        }
        grid.appendChild(door);
      });
      updateProgress();
    }

    function openDoor(day) {
      openedDoors[day] = true;
      localStorage.setItem('escapeCalendarOpened', JSON.stringify(openedDoors));
      renderCalendar();
      showModal(day);
    }

    function showModal(day) {
      const data = calendarData.find(d => d.day === day);
      document.getElementById('modal-title').textContent = 'Day ' + data.day + ' - ' + data.date;
      document.getElementById('modal-theme').textContent = data.theme;
      document.getElementById('modal-avatar').src = avatarImages[day];
      document.getElementById('modal-quip').textContent = '"' + data.quip + '"';
      document.getElementById('modal').classList.add('active');
    }

    function closeModal() {
      document.getElementById('modal').classList.remove('active');
    }

    function updateProgress() {
      const opened = Object.keys(openedDoors).length;
      document.getElementById('progress-text').textContent = 'Doors Opened: ' + opened + ' / 31';
      document.getElementById('progress-fill').style.width = (opened / 31 * 100) + '%';
    }

    document.getElementById('modal').onclick = function(e) {
      if (e.target === this) closeModal();
    };

    createSnowflakes();
    renderCalendar();
  </script>
</body>
</html>
